import React from "react";

const ListRender = () => {
  let list = ["Juan", "Lazaro", "Thiago", "Luan", "Pedro"];
  return (
    <>
      <h2>Lista de presen√ßa</h2>
        <ul>
           {
               list.map((item) => (
                   <li>{item.toUpperCase()}</li>
               ))
           }
        </ul>
    </>
  );
};
export default ListRender;
